kipedia.org\/w\/index.php?title=%D0%A7%D0%B0%D1%82%D0%B0%D0%BB%D0%B4%D0%B6%D0%B0%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D0%BF%D0%B5%D1%80%D0%B5%D0%BC%D0%B8%D1%80%D0%B8%D0%B5&amp;action=edit&amp;redlink=1\" class=\"new\" title=\"\u0427\u0430\u0442\u0430\u043b\u0434\u0436\u0430\u043d\u0441\u043a\u043e\u0435 \u043f\u0435\u0440\u0435\u043c\u0438\u0440\u0438\u0435 (\u0441\u0442\u0440\u0430\u043d\u0438\u0446\u0430 \u043e\u0442\u0441\u0443\u0442\u0441\u0442\u0432\u0443\u0435\u0442)\">\u0427\u0430\u0442\u0430\u043b\u0434\u0436\u0430\u043d\u0441\u043a\u043e\u0435 \u043f\u0435\u0440\u0435\u043c\u0438\u0440\u0438\u0435<\/a> \u0441 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%83%D1%80%D1%86%D0%B8%D1%8F\" title=\"\u0422\u0443\u0440\u0446\u0438\u044f\">\u0422\u0443\u0440\u0446\u0438\u0435\u0439<\/a>. \u0412\u043e\u0435\u043d\u043d\u044b\u0435 \u0434\u0435\u0439\u0441\u0442\u0432\u0438\u044f \u0432\u043e\u0437\u043e\u0431\u043d\u043e\u0432\u0438\u043b\u0438\u0441\u044c 23 \u044f\u043d\u0432\u0430\u0440\u044f 1913 \u0433\u043e\u0434\u0430 \u043f\u0440\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A7%D0%B0%D1%82%D0%B0%D0%BB%D0%B4%D0%B6%D0%B0\" title=\"\u0427\u0430\u0442\u0430\u043b\u0434\u0436\u0430\">\u0427\u0430\u0442\u0430\u043b\u0434\u0436\u0435<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1965\" class=\"mw-redirect\" title=\"1965\">1965<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%B1%D1%80%D0%B8%D1%82%D0%B0%D0%BD%D0%B8%D1%8F\" title=\"\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u044f\">\u0412\u0435\u043b\u0438\u043a\u043e\u0431\u0440\u0438\u0442\u0430\u043d\u0438\u0438<\/a> \u0432\u044b\u0445\u043e\u0434\u0438\u0442 \u0430\u043b\u044c\u0431\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/Rubber_Soul\" title=\"Rubber Soul\">Rubber Soul<\/a> \u0433\u0440\u0443\u043f\u043f\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/The_Beatles\" title=\"The Beatles\">The Beatles<\/a>, \u043a\u043e\u0442\u043e\u0440\u044b\u0439, \u043a\u0430\u043a \u0441\u0447\u0438\u0442\u0430\u0435\u0442\u0441\u044f, \u043f\u043e\u043b\u043e\u0436\u0438\u043b \u043d\u0430\u0447\u0430\u043b\u043e \u043a\u043e\u0440\u0435\u043d\u043d\u044b\u043c \u0438\u0437\u043c\u0435\u043d\u0435\u043d\u0438\u044f\u043c \u0432 \u043c\u0443\u0437\u044b\u043a\u0435 \u043b\u0438\u0432\u0435\u0440\u043f\u0443\u043b\u044c\u0441\u043a\u043e\u0439 \u0447\u0435\u0442\u0432\u0451\u0440\u043a\u0438.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1966\" class=\"mw-redirect\" title=\"1966\">1966<\/a>&#160;\u2014 \u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D1%80%D0%B5%D0%BC%D0%BB%D1%8C\" class=\"mw-redirect\" title=\"\u041c\u043e\u0441\u043a\u043e\u0432\u0441\u043a\u0438\u0439 \u043a\u0440\u0435\u043c\u043b\u044c\">\u041a\u0440\u0435\u043c\u043b\u0451\u0432\u0441\u043a\u043e\u0439 \u0441\u0442\u0435\u043d\u044b<\/a> \u0431\u044b\u043b\u0438 \u043f\u043e\u0433\u0440\u0435\u0431\u0435\u043d\u044b \u043e\u0441\u0442\u0430\u043d\u043a\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D0%B3%D0%B8%D0%BB%D0%B0_%D0%9D%D0%B5%D0%B8%D0%B7%D0%B2%D0%B5%D1%81%D1%82%D0%BD%D0%BE%D0%B3%D0%BE_%D1%81%D0%BE%D0%BB%D0%B4%D0%B0%D1%82%D0%B0\" class=\"mw-redirect\" title=\"\u041c\u043e\u0433\u0438\u043b\u0430 \u041d\u0435\u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e\u0433\u043e \u0441\u043e\u043b\u0434\u0430\u0442\u0430\">\u041d\u0435\u0438\u0437\u0432\u0435\u0441\u0442\u043d\u043e\u0433\u043e \u0441\u043e\u043b\u0434\u0430\u0442\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1967\" class=\"mw-redirect\" title=\"1967\">1967<\/a>&#160;\u2014 \u0432 \u0433\u043e\u0441\u043f\u0438\u0442\u0430\u043b\u0435 \u0413\u0440\u0443\u0442 \u0428\u0443\u0442, <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B5%D0%B9%D0%BF%D1%82%D0%B0%D1%83%D0%BD\" title=\"\u041a\u0435\u0439\u043f\u0442\u0430\u0443\u043d\">\u041a\u0435\u0439\u043f\u0442\u0430\u0443\u043d<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%AE%D0%90%D0%A0\" class=\"mw-redirect\" title=\"\u042e\u0410\u0420\">\u042e\u0410\u0420<\/a>) \u043f\u0440\u043e\u0432\u0435\u0434\u0435\u043d\u0430 \u043f\u0435\u0440\u0432\u0430\u044f \u0432 \u0438\u0441\u0442\u043e\u0440\u0438\u0438 \u043c\u0435\u0434\u0438\u0446\u0438\u043d\u044b \u043e\u043f\u0435\u0440\u0430\u0446\u0438\u044f \u043f\u043e \u043f\u0435\u0440\u0435\u0441\u0430\u0434\u043a\u0435 \u0441\u0435\u0440\u0434\u0446\u0430; \u0435\u0451 \u043f\u0440\u043e\u0432\u0451\u043b \u043f\u0440\u043e\u0444\u0435\u0441\u0441\u043e\u0440 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D1%80%D0%B8%D1%81%D1%82%D0%B8%D0%B0%D0%BD_%D0%91%D0%B0%D1%80%D0%BD%D0%B0%D1%80%D0%B4\" class=\"mw-redirect\" title=\"\u041a\u0440\u0438\u0441\u0442\u0438\u0430\u043d \u0411\u0430\u0440\u043d\u0430\u0440\u0434\">\u041a\u0440\u0438\u0441\u0442\u0438\u0430\u043d \u0411\u0430\u0440\u043d\u0430\u0440\u0434<\/a>, \u0442\u0440\u0430\u043d\u0441\u043f\u043b\u0430\u043d\u0442\u0438\u0440\u043e\u0432\u0430\u0432 \u0441\u0435\u0440\u0434\u0446\u0435 \u0441\u043c\u0435\u0440\u0442\u0435\u043b\u044c\u043d\u043e \u0440\u0430\u043d\u0435\u043d\u043e\u0439 25-\u043b\u0435\u0442\u043d\u0435\u0439 \u0436\u0435\u043d\u0449\u0438\u043d\u044b 55-\u043b\u0435\u0442\u043d\u0435\u043c\u0443 \u0431\u043e\u043b\u044c\u043d\u043e\u043c\u0443.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1969_%D0%B3%D0%BE%D0%B4\" title=\"1969 \u0433\u043e\u0434\">1969<\/a> \u2014 \u043f\u0440\u0438 \u0432\u044b\u043b\u0435\u0442\u0435 \u0438\u0437 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%80%D0%B0%D0%BA%D0%B0%D1%81\" title=\"\u041a\u0430\u0440\u0430\u043a\u0430\u0441\">\u041a\u0430\u0440\u0430\u043a\u0430\u0441\u0430<\/a> (<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%B5%D0%BD%D0%B5%D1%81%D1%83%D1%8D%D0%BB%D0%B0\" title=\"\u0412\u0435\u043d\u0435\u0441\u0443\u044d\u043b\u0430\