u0430\u0440\u0441\u043a\u0438\u0435 \u043e\u0441\u0442\u0440\u043e\u0432\u0430<\/a>) \u043f\u0440\u0438 \u0432\u0437\u043b\u0451\u0442\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0_Convair_990_%D0%BD%D0%B0_%D0%A2%D0%B5%D0%BD%D0%B5%D1%80%D0%B8%D1%84%D0%B5\" title=\"\u041a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430 Convair 990 \u043d\u0430 \u0422\u0435\u043d\u0435\u0440\u0438\u0444\u0435\">\u043f\u043e\u0442\u0435\u0440\u043f\u0435\u043b \u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0443 Convair 990<\/a>, \u043f\u043e\u0433\u0438\u0431\u043b\u0438 155 \u0447\u0435\u043b\u043e\u0432\u0435\u043a.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1984\" class=\"mw-redirect\" title=\"1984\">1984<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D1%85%D0%BE%D0%BF%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F_%D0%BA%D0%B0%D1%82%D0%B0%D1%81%D1%82%D1%80%D0%BE%D1%84%D0%B0\" title=\"\u0411\u0445\u043e\u043f\u0430\u043b\u044c\u0441\u043a\u0430\u044f \u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430\">\u0411\u0445\u043e\u043f\u0430\u043b\u044c\u0441\u043a\u0430\u044f \u043a\u0430\u0442\u0430\u0441\u0442\u0440\u043e\u0444\u0430<\/a>: \u0432 \u0440\u0435\u0437\u0443\u043b\u044c\u0442\u0430\u0442\u0435 \u0443\u0442\u0435\u0447\u043a\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D1%82%D0%B8%D0%BB%D0%B8%D0%B7%D0%BE%D1%86%D0%B8%D0%B0%D0%BD%D0%B0%D1%82\" title=\"\u041c\u0435\u0442\u0438\u043b\u0438\u0437\u043e\u0446\u0438\u0430\u043d\u0430\u0442\">\u043c\u0435\u0442\u0438\u043b\u0438\u0437\u043e\u0446\u0438\u0430\u043d\u0430\u0442\u0430<\/a> \u043d\u0430 \u0437\u0430\u0432\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%81%D1%82%D0%B8%D1%86%D0%B8%D0%B4\" class=\"mw-redirect\" title=\"\u041f\u0435\u0441\u0442\u0438\u0446\u0438\u0434\">\u043f\u0435\u0441\u0442\u0438\u0446\u0438\u0434\u043e\u0432<\/a> \u043f\u043e\u0433\u0438\u0431